import React, { useState, useEffect } from 'react';
import Page from '../Page';
import { Card, CardHeader, Typography, CardContent, CardMedia, Avatar, Box, TextField, FormControl, Button, IconButton, Link } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { red } from '@material-ui/core/colors';
import { useForm } from 'react-hook-form';
import { create_measures, change_measure_name, change_measure_height, change_measure_weight, delete_measures, change_measures } from '../tools/ApiCalls';
import Spinner from '../Spinner';
import { useHistory } from 'react-router-dom'
import DeleteForeverIcon from '@material-ui/icons/DeleteForever';

import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import { Link as RouterLink } from 'react-router-dom';

import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";


const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
    paddingBottom: '20%',
    clipPath: 'polygon(0 0, 100% 0%, 100% 70%, 0% 100%)',
    backgroundColor: theme.palette.secondary.main,
  },
  card: {
    maxWidth: 845,
    minWidth: 820,
    marginBottom: theme.spacing(3),
    position: "relative",
  },
  avatar: {
    background: theme.palette.primary.main,
    color: theme.palette.secondary.main,
    width: 100,
    height: 100,
    border: '2px solid #fff',
    margin: '-80px 54px 0 auto',
    '& > img': {
      margin: 0,
    },
  },
  absoluteIcon: {
    position: 'absolute',
    top: 10,
    right: 10,
    zIndex: 10,
  },
  buttonColor: {
    color: 'red',
  },
}));


export default function UserCard(props) {
    const classes = useStyles();
    const [item, setItem] = useState(props.location.state);
    const [spin, setSpin] = useState(false);
    const history = useHistory();

    const handleDeleteProfile = async () => {
      setSpin(true)
      await delete_measures(item.id)
      setSpin(false)
      history.push('/partners')
    }

    return (
      <Page
        title="Détails"
        back="partners"
        center
      >
        <Card className={classes.card}>
          <CardMedia className={classes.root} >
            <Box p={3}>
              <Typography variant="h5" color="primary" component="h5" style={{ textTransform: 'uppercase' }}>
                {item.name}
              </Typography>
            </Box>
          </CardMedia>
          {/*<Avatar className={classes.avatar}></Avatar>*/}
		  <Carousel>
			<div>
				<img src="/images/laptop-t2.jpg" />
				<p className="legend">Produit 1</p>
			</div>
			<div>
				<img src="/images/laptop-t2.jpg" />
				<p className="legend">Produit 2</p>
			</div>
		  </Carousel>
          <CardContent>
            <table>
              <tr>
                <td>
                  <Typography variant="h6" color="primary" component="h5">
                    Taille:
                  </Typography>
                </td>
                <td>
                  <Typography variant="h6" color="primary" component="h5">
                    {item.height + " cm"}
                  </Typography>
                </td>
              </tr>
              <tr>
                <td>
                  <Typography variant="h6" color="primary" component="h5">
                    Poid:
                  </Typography>
                </td>
                <td>
                  <Typography variant="h6" color="primary" component="h5">
                    {item.weight + " kg"}
                  </Typography>
                </td>
              </tr>
            </table>
          </CardContent>
        </Card>  
      </Page>
    );
  }
